Xlist10new[n_,mu_,x_,J_] := Table[Xlist10[i,mu,x][[J/2+1]],{i,3/2,41/2,1}] . coefflist[[n-3/2]];


Poly[J_, x_, y_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,y],{{Flatten[{Table[Cimp2new[n ,mu1,x, J],{n,7/2,num1}], Table[Xlist4new[n,mu1,x, J],{n,7/2,7/2+nulllist[[1]]}], Table[Xlist6new[n,mu1,x, J],{n,7/2,7/2+nulllist[[2]]}], Table[Xlist8new[n,mu1,x, J],{n,7/2,7/2+nulllist[[3]]}], Table[Xlist10new[n,mu1,x, J],{n,7/2,7/2+nulllist[[4]]}]}]}}];

Poly[J_, x_, y_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,y],{{Flatten[{Table[Cimp2new[n ,mu1,x, J],{n,7/2,num1}], Table[Xlist4[n,mu1,x][[J/2+1]],{n,0,nulllist[[1]]}], Table[Xlist6[n,mu1,x][[J/2+1]],{n,0,nulllist[[2]]}], Table[Xlist8[n,mu1,x][[J/2+1]],{n,0,nulllist[[3]]}], Table[Xlist10[n,mu1,x][[J/2+1]],{n,0,nulllist[[4]]}]}]}}]

NewPoly[b_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[(Gn[i, 10, Sqrt[mu1]*b/Sqrt[3], mu1] + Bn[i, 10, Sqrt[mu1]*b/Sqrt[3], mu1]),{i,7/2,num1}], list0}],Flatten[{Table[(Fn[i, 10,Sqrt[mu1]*b/Sqrt[3], mu1]),{i,7/2,num1}], list0}]},
        {Flatten[{Table[(Fn[i, 10, Sqrt[mu1]*b/Sqrt[3], mu1]),{i,7/2,num1}], list0}],Flatten[{Table[(Gn[i, 10, Sqrt[mu1]*b/Sqrt[3], mu1] - Bn[i, 10, Sqrt[mu1]*b/Sqrt[3], mu1]),{i,7/2,num1}], list0}]}}];

Polydis[b_, x_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[Hn[n,10,b, mu1/3],{n,7/2,num1}], list0}]}}]        
